import React from 'react';
import styles from './Order.module.scss';

const Order = () => {
    return (
        <div className={styles.orderWrapper}>
            <div>
                <span>Бренд: </span>
                <span>DMC</span>
            </div>

            <div>
                <span>Дата заказа: </span>
                <span>22.02.2022</span>
            </div>

            <div>
                <span>Статус заказа: </span>
                <span>активный</span>
            </div>

            <div>
                Посмотреть заказ
            </div>
        </div>
    );
};

export default Order;
